// Process call end data using server-computed analytics
// Server sends: interest_level, completion_rate, collected_responses, objections_raised, question_pairs

const rawData = $input.first().json;
const data = rawData.body || rawData;

// Use server-computed interest level (high/medium/low/not_interested)
const interest = (data.interest_level || 'unknown').toLowerCase();
const completionRate = data.completion_rate || 0;
const objections = data.objections_raised || [];
const transcript = (data.transcript || '').toLowerCase();

// Map server interest_level to lead_type
let leadType = 'cold';
let score = 0;

if (interest === 'high') {
  leadType = 'hot';
  score = 5;
} else if (interest === 'medium') {
  leadType = 'warm';
  score = 2;
} else if (interest === 'not_interested') {
  leadType = 'cold';
  score = -3;
} else {
  leadType = 'cold';
  score = 0;
}

// Boost score based on completion rate
if (completionRate >= 80) score += 2;
else if (completionRate >= 50) score += 1;

// Check for callback signals in transcript
let needsCallback = false;
let callbackTime = null;
if (objections.includes('busy') || transcript.includes('call back') || transcript.includes('call later')) {
  needsCallback = true;
  if (transcript.includes('morning')) callbackTime = 'morning';
  else if (transcript.includes('evening')) callbackTime = 'evening';
  else if (transcript.includes('tomorrow')) callbackTime = 'tomorrow';
  if (leadType === 'cold') leadType = 'scheduled';
}

return {
  call_uuid: data.call_uuid,
  caller_phone: data.caller_phone,
  contact_name: data.contact_name,
  duration_seconds: data.duration_seconds,
  timestamp: data.timestamp,
  // Lead classification
  lead_type: leadType,
  lead_score: score,
  interest_level: interest,
  completion_rate: completionRate,
  questions_completed: data.questions_completed,
  total_questions: data.total_questions,
  // Callback info
  needs_callback: needsCallback,
  callback_time: callbackTime,
  // Objections and summary
  objections: objections,
  call_summary: data.call_summary || '',
  // Collected answers (individual question responses)
  collected_responses: data.collected_responses || {},
  // Q&A pairs for detailed review
  question_pairs: data.question_pairs || [],
  transcript_preview: (data.transcript || '').substring(0, 500)
};

// HOT LEAD - Immediate action needed
const data = $input.first().json;
return {
  action: 'immediate_callback',
  priority: 'HIGH',
  lead_type: 'HOT',
  phone: data.caller_phone,
  contact_name: data.contact_name,
  call_uuid: data.call_uuid,
  duration: data.duration_seconds,
  completion_rate: data.completion_rate,
  call_summary: data.call_summary,
  collected_responses: data.collected_responses,
  message: `HOT LEAD: ${data.contact_name} (${data.caller_phone}) - ${data.questions_completed}/${data.total_questions} questions, ${data.completion_rate}% complete`
};

// SCHEDULED CALLBACK
const data = $input.first().json;
return {
  action: 'schedule_callback',
  priority: 'MEDIUM',
  lead_type: 'SCHEDULED',
  phone: data.caller_phone,
  contact_name: data.contact_name,
  callback_time: data.callback_time || 'not specified',
  call_uuid: data.call_uuid,
  objections: data.objections,
  call_summary: data.call_summary,
  message: `CALLBACK: ${data.contact_name} (${data.caller_phone}) - Time: ${data.callback_time || 'TBD'}, Objections: ${(data.objections || []).join(', ') || 'none'}`
};

// WARM/COLD LEAD - Nurture or archive
const data = $input.first().json;
const isWarm = data.lead_type === 'warm';
return {
  action: isWarm ? 'nurture' : 'archive',
  priority: isWarm ? 'MEDIUM' : 'LOW',
  lead_type: data.lead_type.toUpperCase(),
  phone: data.caller_phone,
  contact_name: data.contact_name,
  call_uuid: data.call_uuid,
  completion_rate: data.completion_rate,
  objections: data.objections,
  call_summary: data.call_summary,
  collected_responses: data.collected_responses,
  message: `${data.lead_type.toUpperCase()}: ${data.contact_name} (${data.caller_phone}) - ${data.completion_rate}% complete, Objections: ${(data.objections || []).join(', ') || 'none'}`
};
